import React from 'react';
import '../../src/Style/personal_loan.css';
import PromoImage from "../images/personal_loan1.jpg";

const PersoanlLoan = () => {

    
    return(  
        <div>
            
            <div className='personalLoanPromo'>
                <h1>Get pre approved personal loan!</h1>

                
                
            </div>
            <div className='personalLoanPromo1'>
                <img src={PromoImage} alt="employee not found" height="300px" className="rounded mx-auto d-block mt-4" />
            </div>
              

        </div>
    );

};

export default PersoanlLoan;
